  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Hospital Compare is a consumer-oriented
  website that provides information on how well hospitals provide recommended care
  to their patients. This information can help consumers make informed decisions about
  health care. Hospital Compare allows consumers to select multiple hospitals and
  directly compare performance measure information related to heart attack, heart
  failure, pneumonia, surgery and other conditions.</p>n\",\n\t\"license_title\":
